// src/components/EfficiencyTable.jsx
import React from 'react';

const EfficiencyTable = ({ data }) => {
  const underperformingStudents = data.filter(item => item.passRate < 50);

  return (
    <>
      <h2>Underperforming Students</h2>
      <table>
        <thead>
          <tr>
            <th>Class</th>
            <th>Teacher</th>
            <th>Time Spent (mins)</th>
            <th>Pass Rate (%)</th>
          </tr>
        </thead>
        <tbody>
          {underperformingStudents.map((item, index) => (
            <tr key={index}>
              <td>{item.class}</td>
              <td>{item.teacher}</td>
              <td>{item.timeSpent}</td>
              <td>{item.passRate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default EfficiencyTable;
